import React from "react";
import { Outlet, Link } from "react-router-dom";


const Home = () => {
    return (
        <div>
            <header className="bg-gray fixed w-100 ph3 pv3 pv4-ns ph4-m ph5-l">
                <nav className="f6 fw6 ttu tracked">
                    <div>
                    <Link className="link dim black dib mr3" to="/App">App</Link>
                    <Link className="link dim black dib mr3" to="/Card">Card</Link>
                    <Link className="link dim black dib mr3" to="/App">App</Link>
                    <Link className="link dim black dib mr3" to="/App">App</Link>
                    </div>
                </nav>
            </header>
            <Outlet />
        </div>
    );
}

export default Home;
